svg.script:

var currency = document.getElementById('currency');
var layers = Array.from(currency.children);
var currentLayerIndex = 0;

function hideLayer(layer) {
    var path = layer.querySelector('path');
    path.style.fillOpacity = 0;
    path.style.fillRule = 'nonzero';
}

function showLayer(layer) {
    var path = layer.querySelector('path');
    path.style.fill = 'rgb(2,2,2)';
    path.style.fillOpacity = 1;
    path.style.fillRule = 'nonzero';
}

// Initially hide all layers except the first one
layers.forEach((layer, index) => {
    if (index !== currentLayerIndex) {
        hideLayer(layer);
    } else {
        showLayer(layer);
    }
});

// Select all elements with the class "bills"
var clickableAreas = document.querySelectorAll('.bills');

// Add click event listener to each clickable area
clickableAreas.forEach(function(area) {
    area.addEventListener('click', function() {
        // Hide current layer
        hideLayer(layers[currentLayerIndex]);

        // Move to next layer
        currentLayerIndex = (currentLayerIndex + 1) % layers.length;

        // Show next layer
        showLayer(layers[currentLayerIndex]);
    });
});
